    static int testSet(String[] set, int value) {
        System.out.print("Checking " + set.length + " Bitbill " + value + " BTC.");
        int billIntact = 0;
        int max = set.length;
        int N_MAX = max / 10;
        for (int counter = 0; counter < max; counter++) {
            if (getBalanceFromWeb(set[counter]).compareTo(BigDecimal.valueOf(value)) != -1) {
                billIntact++;
            }
            if (counter % N_MAX == 0) {
                System.out.print(".." + counter / N_MAX + "0%");
            }
        }
        System.out.println("..done");
        return billIntact;
    }

    static BigDecimal getBalanceFromWeb(String address) {
        HttpURLConnection connection = null;
        URL url = null;
        try {
            url = new URL("https://chainflyer.bitflyer.jp/v1/address/" + address);
        } catch (MalformedURLException me) {
            me.printStackTrace();
        }
        try {
            assert url != null;
            connection = (HttpURLConnection) url.openConnection();
            connection.connect();
            try (BufferedReader brin = new BufferedReader(new InputStreamReader(connection.getInputStream()))) {
                Gson gson = new GsonBuilder().setLenient().create();  // take care of "malformed JSON" error
                WebData data = gson.fromJson(brin, WebData.class);
                return data.confirmed_balance;
            }
        } catch (IOException ioe) {
            ioe.printStackTrace();
        } finally {
            if (connection != null) {
                connection.disconnect();
            }
        }
        return BigDecimal.ZERO;
    }

    private class WebData {
        String address;
        BigDecimal unconfirmed_balance;
        BigDecimal confirmed_balance;
    }

